### Summary of Core Topics, Concepts, Principles, and Equations

#### 1. State Space and Search Algorithms
- **State Space**: The set of all possible states in a problem.
- **State Space Graph**: A graph where nodes represent states and edges represent transitions between states.
- **Search Algorithms**:
  - **Depth First Search (DFS)**: Explores as far as possible along each branch before backtracking.
  - **Breadth First Search (BFS)**: Explores all neighbors at the present depth before moving on to nodes at the next depth level.
  - **Best First Search**: Explores nodes based on a priority queue, often using a heuristic to determine the order.
  - **Hill Climbing**: A local search algorithm that continually moves in the direction of increasing value or decreasing cost.
  - **Depth-First Iterative Deepening (DFID)**: Combines DFS and BFS to find the shortest path.

#### 2. Genetic Algorithms
- **Path Representation**: A sequence of cities representing a tour.
- **Adjacency Representation**: A list where each element represents the city adjacent to the current city in the tour.
- **Ordinal Representation**: A list of indices representing the order in which cities are visited.
- **Partially Mapped Crossover (PMX)**: A genetic operator used to produce offspring from parents in genetic algorithms.

#### 3. Traveling Salesman Problem (TSP)
- **Nearest Neighbor Heuristic**: Constructs a tour by repeatedly visiting the nearest unvisited city.
- **Greedy Heuristic**: Constructs a tour by making the locally optimal choice at each stage.
- **Savings Heuristic**: Constructs a tour by calculating the savings of combining routes.

#### 4. Manhattan Distance
- **Manhattan Distance**: A distance metric used in grid-based pathfinding, calculated as the sum of the absolute differences of their Cartesian coordinates.
  \[
  \text{Manhattan Distance} = |x_1 - x_2| + |y_1 - y_2|
  \]

